import React from "react";
import Map from "./common/Map";

export default function Test() {
  this.map = new Map(
    (id = "myMap"),
    (options = {
      center: { lat: -74.22775268554688, lng: 11.195199752631972 },
      zoom: 16
    })
  );
  console.log(this.map);
  return <div>Hello</div>;
}
